import React,{ UseState,UseEffect } from "react";
import {useNavigate} from 'react-router-dom';
import { Avatar, TextField, Typography } from '@mui/material';
import { Box } from '@mui/system';
import NavbarAdmin from "./adminNav"; 
import axios from 'axios';
const MyProfileA = () => {
    const nav=useNavigate();
    const api=axios.create({
        baseURL:"http://localhost:5000/special"
      });
    useEffect(()=>{
        const api=axios.create({
            baseURL:"http://localhost:5000/special"
          });
        api.get('/watchorder',
      ).then(res=>{
        if(res.status==200)
            console.log(res);
        }).catch(err=>{
            if (err.response) {
                nav('/adlogin') 
                console.log(err);
        } else if (err.request) {
            nav('/adlogin') 
            console.log(err);
      } else {
          // Anything else
          console.log(err);
          nav('/adlogin') 
        
      }
      });
    
      },[])
    return ( 
        <>
     <NavbarAdmin/>
     <Box sx={{
        position:"absolute",

        width:"100%",
        height:"150px",
        backgroundColor:"#860C0C"
     }}>
        <Typography variant= {{xs:"h3",sm:"h4"}} sx={{
            position:"absolute",
            left:"15%",
            top:"60px",
            color:"white",
            alignSelf:"center"
        }}> HARENA.com the leading Ecommerce Website !</Typography>
     </Box>
     <Avatar sx={{
            position:"absolute",
            left:"4%",
            width:"100px",
            top:"110px",
            height:"100px"
        }}></Avatar>
    <Box sx={{
        position:"absolute",
        top:"30%",
        left:"10%",
        width:"80%",
        backgroundColor:"white",

    }}>
        <form>
        <TextField label="Manager FirstName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField label="Manager LastName"sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }}  ></TextField> 
        <br></br>
        <br></br>
        <TextField label="CompanyName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField label="Phone No" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField label="City" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <TextField label="Stream" sx={{
            marginLeft:"20px",
            marginTop:"10px",
            marginBottom:"30px"
        }} ></TextField>
        
        <button type="submit">Edit</button>
        
    </form>
    <br/>
    <br/>
    <br/>
        <div> ------</div>
    </Box>
    </> 
    );
}

export default MyProfileA;
